import React from "react";
import "./App.css";
import Menu from "./Menu.js";
import styled from "styled-components";


const MainContainer = styled.div`
  display: flex;
  flex-direction: column;
  width: 100%;
  height: 100vh;
`;
const StyledDiv1 = styled.div`
  max-width: 100%;
  max-height: 40%;
  background-color: #ffffff;
  display: flex;
  flex-direction: column;

  justify-content: flex-start;
  @media (max-width: 768px) {
    flex-direction: column;
  }

`;

const Name = styled.h1`
  color: #474448;
  font-size: 5em;
  text-align: center;

`;


const StyledDiv2 = styled.div`
width: 100%;
height: 60%;
`;

const Cactus = styled.img`
width: 40vh;
`
const NameDiv = styled.div`

`
const CactusDiv = styled.div`

`


function App() {
  return (
    <MainContainer>
      <StyledDiv1>
      <CactusDiv>
        <Cactus alt="cactus" src="https://res.cloudinary.com/dpfixnpii/image/upload/v1583293953/kisspng-cactaceae-tumblr-plant-drawing-funny-cactus-5b376182835610.997629241530356098538_u7vg8w.png"/>
        </CactusDiv>
       <NameDiv>
       <Name>Katherine Szelag</Name>
       </NameDiv>



      </StyledDiv1>
      <StyledDiv2>
        <Menu />
      </StyledDiv2>
    </MainContainer>
  );
}

export default App;
